import logo from './logo.svg';
import './App.css';
import Matrix from './matrix/Matrix';


function App() {
  data = [
  [0,1],
  [1,2]
]

  return (
    <div className="App">
      <div className="matrix">
        <Matrix data={data}/>
      </div>
    </div>
  );
}

export default App;
